import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="header">
        <img src="<%=require('./images/logo.svg')%>" alt="Логотип сайта Место" className="header__logo"/>
    </header>
    </div>
  );
}

export default App;
